{
}

void
spreader_bc_impl::forecast (int noutput_items, gr_vector_int &ninput_items_required)
{
   ninput_items_required[0] = 1;
}

int
spreader_bc_impl::general_work (int noutput_items,
                   gr_vector_int &ninput_items,
                   gr_vector_const_void_star &input_items,
                   gr_vector_void_star &output_items)
{
   const unsigned char* in = (unsigned char*) input_items[0];
   gr_complex* out = (gr_complex*) output_items[0];

   unsigned index;
   unsigned sign;

   if ((noutput_items < (1 * 8 / 8 * 64)) ||
       (ninput_items[0] < 1))
   {
      return 0;
   }

   index = (((
         (((unsigned)in[0])<<24) | 
         (((unsigned)in[0+1])<<16) | 
         (((unsigned)in[0+2])<<8) | 
         (((unsigned)in[0+3]))
      ) >> (32-0-8)) & ((1<<8)-1));
   sign = index & 0x01;
   index >>= 1;
//printf("=======================================\n");
//printf("Spreading index: %d  sign: %d\n", index, sign);
   memcpy(
      out+0*64, 
      (sign ? (&negWalshTable[index][0]) : (&walshTable[index][0])) , 
      64*sizeof(gr_complex));


   consume_each (1);

   return (1 * 8 / 8 * 64);
}

